    def split_helix(self, id, type, numbers):
        prot = [[None for x in range(7)], [None for y in range(7)]]
        numb = [[None for x in range(7)], [None for y in range(7)]]
        seq = ''
        positions = []

        targets = [
            {'start': self.target_tm1_start.toPlainText(), 'end': self.target_tm1_end.toPlainText(), 'bw': self.target_bw1.toPlainText()},
            {'start': self.target_tm2_start.toPlainText(), 'end': self.target_tm2_end.toPlainText(), 'bw': self.target_bw2.toPlainText()},
            {'start': self.target_tm3_start.toPlainText(), 'end': self.target_tm3_end.toPlainText(), 'bw': self.target_bw3.toPlainText()},
            {'start': self.target_tm4_start.toPlainText(), 'end': self.target_tm4_end.toPlainText(), 'bw': self.target_bw4.toPlainText()},
            {'start': self.target_tm5_start.toPlainText(), 'end': self.target_tm5_end.toPlainText(), 'bw': self.target_bw5.toPlainText()},
            {'start': self.target_tm6_start.toPlainText(), 'end': self.target_tm6_end.toPlainText(), 'bw': self.target_bw6.toPlainText()},
            {'start': self.target_tm7_start.toPlainText(), 'end': self.target_tm7_end.toPlainText(), 'bw': self.target_bw7.toPlainText()},
        ]
        templates = [
            {'start': self.template_tm1_start.toPlainText(), 'end': self.template_tm1_end.toPlainText(), 'bw': self.template_bw1.toPlainText()},
            {'start': self.template_tm2_start.toPlainText(), 'end': self.template_tm2_end.toPlainText(), 'bw': self.template_bw2.toPlainText()},
            {'start': self.template_tm3_start.toPlainText(), 'end': self.template_tm3_end.toPlainText(), 'bw': self.template_bw3.toPlainText()},
            {'start': self.template_tm4_start.toPlainText(), 'end': self.template_tm4_end.toPlainText(), 'bw': self.template_bw4.toPlainText()},
            {'start': self.template_tm5_start.toPlainText(), 'end': self.template_tm5_end.toPlainText(), 'bw': self.template_bw5.toPlainText()},
            {'start': self.template_tm6_start.toPlainText(), 'end': self.template_tm6_end.toPlainText(), 'bw': self.template_bw6.toPlainText()},
            {'start': self.template_tm7_start.toPlainText(), 'end': self.template_tm7_end.toPlainText(), 'bw': self.template_bw7.toPlainText()},
        ]

        if type == 'template':
            seq = self.template_sequence_field.toPlainText()
            positions = templates
        elif type == 'target':
            seq = self.target_sequence_field.toPlainText()
            positions = targets

        for i in range(1, 8):
            start = positions[i - 1]['start']  # template_tm1_start or target_tm1_start
            end = positions[i - 1]['end']  # template_tm1_end or target_tm1_end
            bw = positions[i - 1]['bw']  # template_bw or target_bw

            prot[0][i - 1] = seq[(int(start) - 1):int(end)]
            prot[1][i - 1] = int(bw) - int(start)
            numb[0][i - 1] = [int(start), int(end)]
            numb[1][i - 1] = int(bw)

        if numbers == False:
            return (prot)
        if numbers == True:
            return (numb)

    def align(self):
        self.template = self.split_helix(self.template_sequence_field.toPlainText(), 'template', False)
        self.target = self.split_helix(self.target_sequence_field.toPlainText(), 'target', False)

        align = [[None for x in range(7)], [None for y in range(7)]]

        for i in range(7):
            if self.template[1][i] > self.target[1][i]:
                align[0][i] = self.template[0][i]
                align[1][i] = ''.join(['-'] * (self.template[1][i] - self.target[1][i])) + self.target[0][i]
            elif self.template[1][i] < self.target[1][i]:
                align[0][i] = ''.join(['-'] * (self.target[1][i] - self.template[1][i])) + self.template[0][i]
                align[1][i] = self.target[0][i]
            else:
                align[0][i] = self.template[0][i]
                align[1][i] = self.target[0][i]
            if len(align[0][i]) > len(align[1][i]):
                align[1][i] = align[1][i] + ''.join(['-'] * (len(align[0][i]) - len(align[1][i])))
            elif len(align[1][i]) > len(align[0][i]):
                align[0][i] = align[0][i] + ''.join(['-'] * (len(align[1][i]) - len(align[0][i])))

        return align

    def ssd(self):
        template = self.template_sequence_field.toPlainText()
        target = self.target_sequence_field.toPlainText()
        windowl = 11
        hyd = [None, None]
        hyd[0] = [Helper.hydscale[res] for res in template]
        hyd[1] = [Helper.hydscale[res] for res in target]
        lens = [len(template), len(target)]
        hydr = [[1] * int(windowl / 2) for i in range(2)]
        for k in range(2):
            for i in range(int(windowl / 2), lens[k] - int(windowl / 2)):
                sumb = 0
                for j in range(-int(windowl / 2), int(windowl / 2) + 1):
                    sumb += hyd[k][i + j]
                avg = sumb / windowl
                hydr[k].append(avg)
        for i in range(2):
            hydr[i] += [1] * int(windowl / 2)
        templist = list(template)
        targlist = list(target)
        length = len(templist)
        targalign = ['-'] * (length)
        tempalign = templist
        tempvals = self.split_helix(template, type='template', numbers=True)
        targvals = self.split_helix(target, type='target', numbers=True)
        temphelix = tempvals[0]
        targhelix = targvals[0]
        tempBW = tempvals[1]
        targBW = targvals[1]
        self.name = 'template,target'
        hydiff = []
        self.hydrh = [[[] for x in range(2)] for y in range(7)]
        self.ress = [[] for y in range(7)]
        perresssd = []
        for i in range(7):
            self.summ = [0] * 7
            for j in range(int(targhelix[i][0]) - 1, int(targhelix[i][1])):
                targalign[j + tempBW[i] - targBW[i]] = targlist[j]
            for j in range(int(temphelix[i][0]) - 1, int(temphelix[i][1])):
                self.hydrh[i][0].append(hydr[0][j])
                self.hydrh[i][1].append(hydr[1][targBW[i] - tempBW[i] + j])
                self.summ[i] += ((hydr[1][targBW[i] - tempBW[i] + j]) - (hydr[0][j])) ** 2
            # resno = (tempBW[i] - targBW[i] + targhelix[i][0]) - temphelix[i][0]
            self.ress[i] = [x for x in range(int(temphelix[i][0]), int(temphelix[i][1] + 1))]
            self.value[i] = self.summ[i] / (temphelix[i][1] - temphelix[i][0] + 1)
            hydiff.append(round(self.summ[i], 3))
            perresssd.append(round(self.value[i], 3))

        return (perresssd)

