    def show_hydrophobicity_plot(self):
        Helper.show_hydrophobicity_plot(self.ress, self.hydrh, self.summ, self.value, '', '', self.name, download=False)

    def show_helical_plot(self):
        Helper.show_helical_plot(self.template, self.target, '', '', self.name, download=False)

    def download_result_summary(self):
        hydrophobicity_plot_filenames = Helper.show_hydrophobicity_plot(self.ress, self.hydrh, self.summ, self.value, '', '', self.name, download=True)
        helical_plot_filenames = Helper.show_helical_plot(self.template, self.target, '', '', self.name, download=True)
        Helper.generate_result_summary(self.alignment, 'Template', 'Target', self.template_sequence, self.target_sequence, self.template_number, self.target_number, hydrophobicity_plot_filenames, helical_plot_filenames)
